/*!
根据位反序规则，对数据进行重排

    Input:  xy -- data will be reversed
            cnt -- count of xy
    Output: xy -- reversed data
*/
void bit_reverse(CComplexNum *xy, int cnt)
{
    int i, j, k;
    float dr, di; //real, image
    j = cnt>>1;

    #pragma MUST_ITERATE(32, ,2);
    for ( i = 1; i < cnt-1; i++) {
        if (i < j) {
            dr = xy[j].real;
            di = xy[j].image;
            xy[j].real = xy[i].real;
            xy[j].image = xy[i].image;
            xy[i].real = dr;
            xy[i].image = di;
        }
        k = cnt>>1;
        //while (j >= k && j) { //理论上不需要&&j,只是考虑到受到干扰时，避免进入死循环
        while (j >= k) {
            j -= k;
            k >>= 1;
        }
        j += k;
    }
}

/*!
For the DSP, should call the DSPF_sp_cfftr2_dit() function in fftr2.sa
*/
void DSPF_sp_cfftr2_dit(float *x, float *w, short n)
{
    short n2, ie, ia, i, j, k, m;
    float rtemp, itemp, c, s;

    n2 = n;
    ie = 1;

    for(k=n; k > 1; k >>= 1) {
        n2 >>= 1;
        ia = 0;
        for(j=0; j < ie; j++) {
            c = w[2 * j];
            s = w[2 * j+1];
            for(i=0; i < n2; i++) {
                m = ia + n2;
                rtemp         = c * x[2 * m]   + s * x[2 * m+1];
                itemp         = c * x[2 * m + 1] - s * x[2 * m];
                x[2 * m]      = x[2 * ia] - rtemp;
                x[2 * m + 1]  = x[2 * ia + 1] - itemp;
                x[2 * ia]     = x[2 * ia] + rtemp;
                x[2 * ia + 1] = x[2 * ia + 1] + itemp;
                ia++;
            }
            ia += n2;
        }
        ie <<= 1;
    }
}

/*!
Fast Fourier Transform of Base 2. Improved by seapex

    Input:  xy -- Data will be transformed
            cnt -- Count of xy
    Outpu:  xy -- Transformed data
*/
void FFTBase2Sea(CComplexNum *xy, int cnt)
{
    int i, j, k, k_pair, n, n_hlf;
    float xy_r, xy_i, w_r, w_i, tmp_r, tmp_i, ftmp;

    for (n=2; n<=cnt; n<<=1) {  //n=蝶群宽度
        n_hlf = n>>1;
        xy_r = 1.0;
        xy_i = 0;
        //W20~WN0
        //w_r = cossp(kM_PI/n_hlf);   //for DSP only
        //w_i = sinsp(kM_PI/n_hlf);   //for DSP only
        w_r = cos(kM_PI/n_hlf);
        w_i = sin(kM_PI/n_hlf);
        for (j=0; j<n_hlf; j++) {
            k = j;
            while (k<cnt) {
                k_pair = k+n_hlf;
                tmp_r = xy[k_pair].real*xy_r + xy[k_pair].image*xy_i; // Dr*cos + Di*sin
                tmp_i = xy[k_pair].image*xy_r - xy[k_pair].real*xy_i; // Di*cos - Dr*sin
                xy[k_pair].real = xy[k].real - tmp_r;   //Br = Cr - (Dr*cos + Di*sin)
                xy[k_pair].image = xy[k].image - tmp_i; //Bi = Cr - (Di*cos - Dr*sin)
                xy[k].real = xy[k].real + tmp_r;    //Ar = Cr + Dr*cos + Di*sin
                xy[k].image = xy[k].image + tmp_i;  //Ai = Cr + Di*cos - Dr*sin
                k += n;
            }
            ftmp = xy_r*w_r - xy_i*w_i;    //cos(a+b) = cos(a)cos(b)-sin(a)sin(b);
            xy_i = xy_i*w_r + xy_r*w_i;    //sin(a+b) = sin(a)cos(b)+cos(a)sin(b);
            xy_r = ftmp;
        }
    }
}

/*!
Fast Fourier Transform of Base 2

    Input:  xy -- Data will be transformed
            cnt -- Count of xy
            type -- Algorithm type. 0=FFTBase2Sea, 1=DSPF_sp_cfftr2_dit
    Outpu:  xy -- Transformed data
*/
void FFTBase2(CComplexNum *xy, int cnt, int type)
{
    int i, n;
    
    if (type==1) {
        DSPF_sp_cfftr2_dit((float *)xy, (float *)tw, cnt);
        bit_reverse(xy, cnt);   //对要变换的数据，进行位反序重排
    } else {
        bit_reverse(xy, cnt);   //对要变换的数据，进行位反序重排
        FFTBase2Sea(xy, cnt);
    } 

    n = cnt>>1;
    for (i=0; i<n; i++) {
        xy[i].real /= n;
        xy[i].image /= n;
    }

}

void FFTBase2Test(CComplexNum *xy, int cnt)
{
    FFTBase2Sea(xy, cnt);
}



